  false,\n\t\"url\": null,\n\t\"notes\": \"This EnviroAtlas dataset includes analysis
  by NatureServe of species that are Imperiled (G1/G2) or Listed under the U.S. Endangered
  Species Act (ESA) by 12-digit Hydrologic Units (HUCs). The analysis results are
  for use and publication by both the LandScope America website and by the EnviroAtlas.
  Results are provided for the total number of Aquatic Associated G1-G2/ESA species,
  the total number of Wetland Associated G1-G2/ESA species, the total number of Terrestrial
  Associated G1-G2/ESA species, and the total number of Unknown Habitat Association
  G1-G2/ESA species in each HUC12. NatureServe is a non-profit organization dedicated
  to developing and providing information about the world's plants, animals, and ecological
  communities. NatureServe works in partnership with 82 independent Natural Heritage
  programs and Conservation Data Centers that gather scientific information on rare
  species and ecosystems in the United States, Latin America, and Canada (the Natural
  Heritage Network). NatureServe is a leading source for biodiversity information
  that is essential for effective conservation action. This dataset was produced by
  NatureServe to support research and online mapping activities related to EnviroAtlas.
  EnviroAtlas (https://www.epa.gov/enviroatlas) allows the user to interact with a
  web-based, easy-to-use, mapping application to view and analyze multiple ecosystem
  services for the contiguous United States. The dataset is available as downloadable
  data (https://edg.epa.gov/data/Public/ORD/EnviroAtlas) or as an EnviroAtlas map
  service. Additional descriptive information about each attribute in this dataset
  can be found in its associated EnviroAtlas Fact Sheet (https://www.epa.gov/enviroatlas/enviroatlas-fact-sheets).\",\n\t\"license_title\":
